import React from 'react';
import moment from 'moment';

//app
import styles from './LossActionTable.styles';
import { TableCell } from 'components';
import * as utils from 'utils';
import config from 'config';

//mui
import { makeStyles, TableRow, Link, Typography } from '@material-ui/core';

export function LossActionTableRowView({ data, handleViewClaimClick, columnProps}) {
  const classes = makeStyles(styles, { name: 'LossActionTable' })();

  console.log("data ", data)

  return (
    <>
      <section>

      </section>
      <TableRow key={data.claimID} data-testid={`search-row-${data.actionId}`} hover>
        <TableCell {...columnProps('actionId')} data-testid={`row-col-${data.actionId}`}>
          {data.actionId}
        </TableCell>
        <TableCell {...columnProps('name')} data-testid={`row-col-${data.name}`}>
          {data.name}
        </TableCell>
        <TableCell {...columnProps('description')} data-testid={`row-col-${data.description}`}>
          {data.description}
        </TableCell>
        <TableCell {...columnProps('team')} data-testid={`row-col-${data.team}`}>
          {data.team}
        </TableCell>
        <TableCell {...columnProps('assignedTo')} data-testid={`row-col-${data.assignedTo}`}>
          {data.assignedTo}
        </TableCell>
        <TableCell {...columnProps('createdDate')} data-testid={`row-col-${data.createdDate}`}>
          {utils.string.t('format.date', {
            value: { date: data?.createdDate, format: config.ui.format.date.textTime },
          })}
        </TableCell>
        <TableCell {...columnProps('targetDate')} data-testid={`row-col-${data.targetDate}`}>
          {utils.string.t('format.date', {
            value: { date: data?.targetDate, format: config.ui.format.date.text },
          })}
        </TableCell>
        <TableCell {...columnProps('priority')} data-testid={`row-col-${data.priority}`}>
          {data.priority}
        </TableCell>
        <TableCell {...columnProps('status')} data-testid={`row-col-${data.status}`}>
          {data.status}
        </TableCell>
        <TableCell {...columnProps('insured')} data-testid={`row-col-${data.insured}`}>
          {data.insured}
        </TableCell>
        <TableCell {...columnProps('division')} data-testid={`row-col-${data.division}`}>
          {data.division}
        </TableCell>
      </TableRow>
    </>
  );
}
